Storyline:

    The story involves an overland journey through hostile Cheyenne territory to rescue two white women captured by the Cheyenne. One has turned renegade and is not anxious to be rescued as she is about to be married to Chief Thunder Hawk. Vera Miles dies and the cavalry comes to the rescue in the nick of time by a stream called Feather River. Knives, arrows, spears and tomahawks all come flying at the audience. Frank Lovejoy discourages a rattlesnake with tobacco juice and even gets off a shot into the audience.



